	"zjblessons/Worklist/view/Fragment/DateTime.fragment.xml":'<core:FragmentDefinition\n\txmlns:core=\'sap.ui.core\'\n\txmlns=\'sap.m\'><Dialog\n            beforeClose=\'beforeCloseHandler\'\n            validateFieldGroup=\'validateFieldGroupRegistration\'\n\t\t\tresizable=\'true\'\n\t\t\tdraggable=\'true\'\n            id=\'dateTimeDialog\'\n\t\t\ttitle=\'{i18n>ttlTimeDateDialog}\'\n\t\t\tclass=\'sapUiSizeCompact\'\n\t\t><VBox\n\t\t\t\tclass="sapUiSmallMargin"><DatePicker\n                    fieldGroupIds=\'datePicker\'\n                    id="DP1"\n                    placeholder="{i18n>phEnterDate}"\n                    class="sapUiSmallMarginBottom"\n                    valueFormat="dd/MM/y"\n                    displayFormat="dd/MM/y"/><TimePicker\n                    fieldGroupIds=\'timePicker\'\n                    id="TP1"\n                    placeholder="{i18n>phEnterTime}"\n                    valueFormat="HH:mm:ss"\n                    displayFormat="HH:mm:ss"\n                /></VBox><footer><Toolbar><Button\n\t\t\t\t\t\t\ttext=\'{i18n>btnCloseDialog}\'\n\t\t\t\t\t\t\ticon=\'{i18n>iClose}\'\n\t\t\t\t\t\t\tpress=\'onPressCloseCreateDialog\'/><ToolbarSpacer/><Button\n                            id=\'timeAndDateSaveBtn\'\n\t\t\t\t\t\t\ttext=\'{i18n>btnSaveMaterial}\'\n\t\t\t\t\t\t\ticon=\'{i18n>iSave}\'\n\t\t\t\t\t\t\tpress=\'onpRressRegistrationSave\'\n\t\t\t\t\t\t\ttype="Emphasized"/></Toolbar></footer></Dialog></core:FragmentDefinition>',
